import { useAuth0 } from "@auth0/auth0-react";
import { get } from "https";
import { useEffect, useState } from "react";
import { Col, Container, Row } from "react-bootstrap";
import ExerciseTracker from "../Components/ExerciseTracker/ExerciseTracker";
import Sidebar from "../Components/Sidebar";
import WeightTracker from "../Components/WeightTracker/WeightTracker";

function Dashboard() {
  const [showWeightModal, setShowWeightModal] = useState(false);
  const [showDayModal, setShowDayModal] = useState(false);
  const [accessToken, setAccessToken] = useState("");

  const { getAccessTokenSilently } = useAuth0();

  const foo = async () => {
    const accessToken = await getAccessTokenSilently();
    setAccessToken(accessToken);
  }

  useEffect(() => {
    foo();
  }, []);

  return (
    <Container fluid={true}>
      {accessToken}
      <Row>
        <Col md="auto" className="mt-4">
          <Sidebar
            setShowWeightModal={setShowWeightModal}
            setShowDayModal={setShowDayModal}
          />
        </Col>

        <Col className="mb-4">
          <WeightTracker show={showWeightModal} setShow={setShowWeightModal} />

          <ExerciseTracker show={showDayModal} setShow={setShowDayModal} />
        </Col>
      </Row>
    </Container>
  );
}

export default Dashboard;
